      <p>
        Hi there! My name is [Augusto Herrera] and I'm a [Js Fullstack Developer]. I love
        coding and building things with the lattes technologies.
      </p>
      <img nameclass={styles.img} src={augusto} alt="My Photo" />
    </div>
  );
}

